import { connect, useDispatch } from 'react-redux';
import { withRouter } from 'react-router-dom';

function BackToBlack(props) {

  let dispatch = useDispatch();

  const sendInfo = (values, path) => {
    switch (path) {
      case 'forward':
        dispatch({
          type: 'UPDATE_CUSTOMER',
          payload: values
        });
        dispatch({
          type: 'QUOTE_PROGRESS',
          payload: { divisor: 8, step_number: 8 }
        });
        props.history.push('./thank-you');
        break;
      case 'back':
        dispatch({
          type: 'QUOTE_PROGRESS',
          payload: { divisor: 8, step_number: 6 }
        });
        props.history.push('./email');
        break;
      default:
    }
  };

  return (
    <div>

      <h2>Back to Black</h2>
      <p>Consider our Back to Black service for premium support and service.</p>

      <br></br>
      <button onClick={() => sendInfo('', 'back')}>Go to sidewalk</button>
      <button className='btn primary_btn' onClick={() => sendInfo('', 'forward')}>Submit</button>

    </div>
  );
}

export default connect()(withRouter(BackToBlack));
